    [],nt"revision_timestamp": "2016-02-27T17:19:10.879412",nt"name": "va-use-of-ssa-earnings-data-va-earn",nt"isopen":
    true,nt"url": null,nt"notes": "The purpose of this matching program is
    to provide the Department of Veterans Affairs (VA), both the Veterans Benefit Administration
    (VBA) and Veterans Health Administration (VHA), with data from income tax return
    information disclosed to SSA to verify eligibility for VA health benefit programs.
    The SSA data is used to verify earnings information. VHA will also use SSA's records
    of wage and self-employment income to verify the veterans' employment status. Health
    insurance information (obtained from veteran, spouse and/or employer during employment
    verification) and/or income data (verification of which changes eligibility for
    medical care) may be forwarded to VHA medical center facilities for eligibility
    category changes and potential billing activities.  VA also submits a weekly file
    through this exchange to support the VA/SSA/IRS White House Data Sharing initiative
    to reduce the VA backlog.",nt"license_title": "Other License Specified",nt"extras":
